const modes = {
  mode1: "Upit engleske riječi uz odabir hrvatskog prijevoda",
  mode2: "Upit hrvatske riječi uz odabir engleskog prijevoda",
  mode3: "Upit izgovorom engleske riječi uz pisanje riječi na engleskom",
  mode4:
    "Upit tekstualnim oblikom engleske riječi uz snimanje izgovora u zvučnu datoteku",
};

export default modes;
